import React, {useEffect, uyseState} from 'react';
import { makeStyles } from '@mui/styles';
import Box from '@mui/material/Box';
import Paper from '@mui/material/Paper';
import { Grid, Typography, Stack } from '@mui/material';

const ENTITIES = ['Entity1', 'Entity2', 'Entity3', 'Entity4', 'Entity5', 'Entity6', 'Entity7', 'Entity8', 'Entity9', 'Entity10'];

const useStyles = makeStyles((theme) => ({
    root: {
        padding: '16px',
        margin: 'auto'
    },
    entity: {
        cursor: 'pointer',
        padding: '16px',
        '&:hover': {
            opacity: '0.7'
        }
    }
}));

const ChooseEntity = () => {
    const classes = useStyles();


    return (
        <Box className={classes.root}>

            <Stack spacing={2}>
                <Grid container spacing={2}>
                    {ENTITIES.map((entity) =>
                        <Grid item xs={6} md={3}>
                            <Paper elevation={3} className={classes.entity}>
                                <Typography variant="h4">{entity}</Typography>
                            </Paper>
                        </Grid>
                    )}
                </Grid>
            </Stack>
        </Box >
    );
};

export default ChooseEntity;
